import React, {useState} from "react";

function App() {
  const [value, setValue] = useState(1);
  const [count, setCount] = useState(10);

const addValue = () => {
  setValue (value + 1)
};

const addCount = () => {
  setCount (count + 10)
};


  return (
    <div className="App">
      <div>Value: {value}</div>
      <div>Count: {count}</div>
      <button onClick={addValue}>Add value</button>
      <button onClick={addCount}>Add count</button>
    </div>
  );
}

export default App;
